import React from "react";
import './Population.css'
class Population extends React.Component{
    constructor(props) {
        super();
        this.props = props;



    }

    render(){

        return (
            <div className={"population"}>
                <Bubble data={this.data}/>
            </div>
        );
    }
}
export default Population;
